CREATE TABLE [UC] (
ID_UC INT,
COD_UC VARCHAR(12),
NOME_UC VARCHAR(200),
ID_IUCN INT,
ID_BIOMAPREDOMINANTE INT,
ID_RESERVABIOSFERA INT,
FOREIGN KEY (ID_IUCN) REFERENCES IUCN(ID_IUCN), 
FOREIGN KEY (ID_BIOMAPREDOMINANTE) REFERENCES BIOMA(ID_BIOMA), 
FOREIGN KEY (ID_RESERVABIOSFERA) REFERENCES RESERVABIOSFERA(ID_RESERVABIOSFERA),
PRIMARY KEY(ID_UC)
);



CREATE TABLE [IUCN] (
ID_IUCN INT,
CATEGORIA_IUCN VARCHAR (3),
NOME_IUCN VARCHAR (100),
PRIMARY KEY (ID_IUCN)
);



CREATE TABLE [BIOMA] (
ID_BIOMA INT,
NOME_BIOMA VARCHAR (30),
REGIAOPREDOMINANTE_BIOMA VARCHAR (15),
PRIMARY KEY (ID_BIOMA)
);


CREATE TABLE [RESERVABIOSFERA] (
ID_RESERVABIOSFERA INT,
NOME_RB VARCHAR (50),
AREA_RB INT,
PRIMARY KEY (ID_RESERVABIOSFERA)
);



CREATE TABLE [UC_ADMINISTRACAO] (
ID_ADM INT,
ID_UC INT,
ID_IUCN INT,
ESFERA_ADMINISTRATIVA VARCHAR (15),
ANO_CRIACAO INT,
ATO_LEGAL_CRIACAO VARCHAR (100),
CONSELHO_GESTOR BIT,
FOREIGN KEY (ID_UC) REFERENCES  UC (ID_UC),
FOREIGN KEY (ID_IUCN) REFERENCES IUCN (ID_IUCN),
PRIMARY KEY (ID_ADM)
);

